"""
Given a string, find the length of the longest substring without repeating characters.

Examples:

Given "abcabcbb", the answer is "abc", which the length is 3.

Given "bbbbb", the answer is "b", with the length of 1.

Given "pwwkew", the answer is "wke", with the length of 3.
Note that the answer must be a substring, "pwke" is a subsequence and not a substring.
"""


class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        # import string
        # max_str_length = 95
        # str_length = len(s)
        # if str_length <= 1:
        #     return str_length
        #
        # max_length = 0
        # for inx in range(str_length - 1):
        #     if max_length > str_length - inx - 1 or max_length == max_str_length:
        #         return max_length
        #
        #     stack = [s[inx]]
        #     for value in s[inx + 1:]:
        #         if value not in stack:
        #             stack.append(value)
        #         else:
        #             break
        #     if len(stack) > max_length:
        #         max_length = len(stack)
        #
        # return max_length

        # use code from leetcode
        cache = {}  # for cache different char position
        cmax = start = 0  # max chars length and start position

        for inx in range(len(s)):
            c = s[inx]
            if c in cache and cache[c] >= start:  # for repeat char
                if (inx - start) > cmax:
                    cmax = inx - start
                start = cache[c] + 1

            cache[c] = inx  # update latest position
        if (len(s) - start) > cmax:
            cmax = len(s) - start

        return cmax


if __name__ == '__main__':
    import time

    start = time.time()
    s = Solution()
    assert s.lengthOfLongestSubstring("abcabcbb") == 3
    assert s.lengthOfLongestSubstring("abba") == 2
    assert s.lengthOfLongestSubstring("bbbbb") == 1
    assert s.lengthOfLongestSubstring("pwwwwwawkew") == 4
    assert s.lengthOfLongestSubstring("c") == 1
    assert s.lengthOfLongestSubstring("cd") == 2

